        @keyframes spin {
            from {
                transform: rotate(0)
            }

            to {
                transform: rotate(359deg)
            }
        }

        .fade {
            opacity: 0;
            -webkit-transition: opacity .15s linear;
            -o-transition: opacity .15s linear;
