        .tooltip {
            position: absolute;
            z-index: 1070;
            display: block;
            visibility: visible;
            font-family: Roboto, "Helvetica Neue", Helvetica, Arial, sans-serif;
            font-size: 12px;
            font-weight: 400;
            line-height: 1.4;
            opacity: 0;
            filter: alpha(opacity=0)
        }

        .fade.in {
            opacity: 1
        }

        .tooltip.in {
            opacity: .9;
            filter: alpha(opacity=90)
        }

        .tooltip.top {
            margin-top: -3px;
            padding: 5px 0
        }

